import React from "react";
import Card from "../../componants/card/Card";
import styles from "../../style/common/card.module.css";
import Title from "../../componants/common/Title";

function Marvel() {
  const data = [
    {
      src: "/toy-images/01.png",
      title: "Spider-Man No Way-Home",
      desc: "₹1,79,944.94",
    },
    {
      src: "/toy-images/02.png",
      title: "Iron-Man",
      desc: "₹1,15,704.60",
    },
    {
      src: "/toy-images/03.png",
      title: "Captain America",
      desc: "₹1,25,871.49",
    },
    {
      src: "/toy-images/04.png",
      title: "Black Panther",
      desc: "₹35,719.07",
    },
    {
      src: "/toy-images/05.png",
      title: "Thunder Thor",
      desc: "₹8,421.74 + Tax",
    },
    {
      src: "/toy-images/06.png",
      title: "Hulk",
      desc: "₹47,145.57",
    },
    {
      src: "/toy-images/07.png",
      title: "Dr.Strange",
      desc: "₹13,899.00",
    },
    {
      src: "/toy-images/08.png",
      title: "Thenos",
      desc: "₹29,241.05",
    },
  ];

  return (
    <>
      <Title title="MARVEL TOY'S" />
      <div className={styles.map1}>
        {data.map((value, index) => {
          return (
            <Card
              key={index}
              src={value.src}
              title={value.title}
              desc={value.desc}
            />
          );
        })}
      </div>
    </>
  );
}

export default Marvel;
